import React from 'react';
import { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import {Button, Container, Nav, Row, Col, Form, FormControl} from 'react-bootstrap';
import { Link } from 'react-router-dom';
import './home.css'

function Rankchart(props){
  const data = [
    { rank: 1, item: '하루하루' },
    { rank: 2, item: '붉은노을' },
    { rank: 3, item: '자국' },
    { rank: 4, item: '퀸카(QueenCard)' },
    { rank: 5, item: '독기' },
    { rank: 6, item: '400km' },
    { rank: 7, item: 'Spicy' },
    { rank: 8, item: 'Hype Boy' },
    { rank: 9, item: '헤어지자 말해요' },
    { rank: 10, item: '낮 밤' }
  ];

  return (
<div className="cent" style={{ margin: "20px", width: "100%" }}>
<div style={{ display: 'flex', justifyContent: 'center' }}>
<table className = 'cent'>
  <tbody>
<tr>
      <td colSpan="2" style={{ textAlign: 'left' }}>
        <p>인기차트</p>
      </td>
</tr>    

          {[0, 1, 2, 3, 4].map((rowIndex) => (
            <tr key={rowIndex} style={{ textAlign : 'left'}}>
              <td className = 'td400'>{data[rowIndex].rank} {' '} {data[rowIndex].item}</td>
              <td className = 'td400'>{data[rowIndex + 5].rank} {' '} {data[rowIndex + 5].item}</td>
            </tr>
          ))}
</tbody>
</table>  
</div>    
</div>
  );
};

export default Rankchart;
